(function(module) {
try {
  module = angular.module('partials');
} catch (e) {
  module = angular.module('partials', []);
}
module.run(['$templateCache', function($templateCache) {
  $templateCache.put('test1.html',
    '<div>\n' +
    '\n' +
    '    Name: \n' +
    '    <br />\n' +
    '    <input type="text" ng-model="name" />\n' +
    '    <br />\n' +
    '\n' +
    '    <ul>\n' +
    '        <li ng-repeat="cust in customers | filter:name">{{ cust.name }} || {{ cust.city }}</li>\n' +
    '    </ul>\n' +
    '\n' +
    '    <br />\n' +
    '    Customer Name:<br />\n' +
    '    <input type="text" ng-model="newCustomer.name" />\n' +
    '    <br />\n' +
    '    City:<br />\n' +
    '    <input type="text" ng-model="newCustomer.city" />\n' +
    '    <br />\n' +
    '    <button ng-click="addCustomer()">Add Customer</button>\n' +
    '\n' +
    '    <br />\n' +
    '\n' +
    '    <a href="/test">Test</a>\n' +
    '\n' +
    '</div>');
}]);
})();

